import React, { Component } from 'react';
import './App.css';
import InstructorApp from './component/InstructorApp';
import MenuComponent from './component/MenuComponent';

class App extends Component {
  render() {
    return (
    <div>
      <MenuComponent/>
        <div className="container">
          <InstructorApp />
        </div>
      </div>
    );
  }
}

export default App;
